(1,	'12345677',	'Lorem ipsum, atau ringkasnya lipsum, adalah teks standar yang ditempatkan untuk mendemostrasikan elemen grafis atau presentasi visual seperti font, tipografi, dan tata letak.',	'reza'),
(2,	'12345677',	'tau ahh capee, no komen',	'billa'),
(3,	'15218276',	'Pelupa, Tapi bisa nanganin pake alarm. Belum pernah ikut organisasi atau ukm. Agak grogi. Pernah ikut madas tapi gak diterima. Pengen punya pengalaman. Dirumah suka bantu ibu jaga toko. Berharap gaji 500. Gak mau punya pacar sampe nikah. Agak ragu kalo mau dinas.',	'Reza'),
(4,	'15218276',	'Kekurangannya mudah lupa namun bisa menangani kekurangannya, kelebihannya dia tepat waktu, menyukai hal baru. tidak mengikuti organisasi. aktivitasnya lebih banyak dirumah membantu orang tua, ketika menjawab mengenai dinas sedikit ragu..',	'Nabilla'),
(5,	'12119481',	'-Terlihat sopan dan lebih dewasa\r\n-Aktif dalam mengikuti seminar\r\n-Keberatan jika bertugas diluar region bekasi dan mengutamakan kuliah\r\n-Percaya diri dalam menjawab',	'Nadia Damay'),
(6,	'22219789',	'Kurang sabaran (Suka buru2). Bisa bekerja sama. Giat. Suka belajar. Bisa bekerja dengan baik. Punya pacar tapi LDR. Mau ngehandle kerjaan orang kalo orangnya gak bener.',	'Reza'),
(7,	'22219789',	'selalu mencoba hal hal baru, namun tidak pantang menyerah, kekurangan tidak sabaran. dalam menjawab kelebihan  ragu ragu, bisa menangani masalahnya dengan asisten lain/ lebih milih mengalah dari pada memperpanjang masalah. dalam menjawab semua pertanyaan ragu2',	'Nabilla'),
(8,	'11219644',	'-Berbicara dengan baik walaupun terbata-bata\r\n-Suka nervous tetapi tetap dipaksakan untuk maju di depan umum\r\n-Setuju jika mengikuti dinas ke region lain\r\n-Sikapnya kurang bagus\r\n\r\n(Belum direkomendasi)',	'Rifky Andhika'),
(9,	'13117144',	'Bisa tepat waktu, jujur, bisa kerja sama. Susah fokus, bisa ngatasin dengan cara bagi waktu. Udah pernah masuk LABSI. ',	'Reza'),
(10,	'13117144',	'Kekurangannya susah fokus,  dapat  menangani masalhnya dengan baik.',	'Nabilla'),
(11,	'21219796',	'-Suara logatnya lucu ceriawkwk\r\n-Bisa Masak\r\n-Percaya diri dalam berbicara\r\n-Bersedia ditugaskan dimanapun\r\n-Mengutamakan kuliah dibanding lab\r\n-Rekomen sedikit',	'Nadia Damay'),
(12,	'13219973',	'Dia bilang sendiri katanya agak lemot. Suka nyatet atau ngerekam biar bisa dengerin lagi. Aktif di kegiatan sosial. Agak kaku tapi jujur banget. Polos. Baru pertama kali daftar lab. Aktif karang taruna. Friendly orangnya.',	'Reza'),
(13,	'13219973',	'kelebihan disiplin, bekerjasama dalam kelompok, kekurangannya lemot namun bisa menangani masalah, anaknya friendly, cukup aktif dalam organisasi.',	'Nabilla'),
(14,	'12219572',	'-Orangnya disiplin dan management waktu yang bagus\r\n-Sudah kerja dibagian lain (Kerja dibagian mencari nasabah)\r\n-Bisa diandalkan dalam team work\r\n-Siap ditugasin dinas ke region lain\r\n-Memilih kelas daripada assisten lab\r\n-Sudah punya pacar tetapi tidak masalah waktu pacaran\r\n\r\n(Rekomendasi)',	'Rifky Andhika'),
(15,	'13118071',	'Proaktif. Dapat berkomunikasi dengan baik. Kurang pede katanya. pernah daftar di lepkom sama ilab tapi ditolak. Tanggung jawab. Punya pacar. Orangnya agak kaku tapi bahasanya bagus. Nanya project ada apa engga buat programmer.',	'Reza'),
(16,	'13118071',	'Terlalu kaku, aktif dan dapat berkomunikasi. kekurangan percaya diri namun selalu berusah menutupi kekurangannya tersebut. anaknya sangat pantang menyerah. minat terhadap lab ini tinggi',	'Nabilla'),
(17,	'55419249',	'Kalo udah suka sesuatu selalu ngerjain terus. Kurang motivasi kalo ngelakuin sesuatu. Banyak kegiatan lain kaya ukm sepak bola, DSC. Orangnya bingungan. Baru pertama kali daftar lab. Gajinya maunya nego. Jadwal juga kalo bisa maunya gak bentrok. Prioritas kuliah, lab, baru ukm.',	'Reza'),
(18,	'55419249',	'kebanyakan ragu menjawab, tidak memikirkan perihal gaji, kelebihannya tekun dengan apa yang sudah dijalanin.',	'Nabilla'),
(19,	'54418837',	'-Fokus terhadap 1 tujuan, tidak mudah diusik\r\n-Mengasah diri lebih ke website\r\n-Bisa berbagi waktu dan keberatan sedikit jika ditugaskan diregion lain.\r\n-Bingung tentang kelebihannya\r\n-Gondrong, rela dicukur tapi lebih baik dikuncir katanya.\r\n-Sedikit rekomen',	'Nadia Damay'),
(20,	'20219003',	'-Publik Speakingnya baik dan tutur katanya tertata baik\r\n-Dalam menjawab pertanyaan lancar dan percaya diri\r\n-Bertanggung jawab dan tidak mudah putus asa\r\n-Organisasi Sharia Economic Forum, pengalaman dalam panitia seminar dll\r\n-Bersedia ditugaskan dimanapun\r\n-Sangat Rekomen',	'Nadia Damay'),
(21,	'15119770',	'Ikut BEM FIKTI dengan berbagai macam acaranya. Suka belajar. Suka bekerja sama dalam tim. Bukan orang yg suka berbicara, suka nunda kerjaan. BIcaranya lancar. punya banyak pengalaman. Keberatan kalo dinas tapi mau. Punya pacar anak BEM. Orangnya bucin. ',	'Reza'),
(22,	'15119770',	'aktif dalam organisasi, suka belajar hal baru, bisa bekerja sama, kekurangan menunda tugas namun akan tetap dikerjakan. keberatan dinas tapi jika sudah diwajib kan dia akan tetap bertanggung jawab. Rekomendasi bgttt',	'Nabilla'),
(23,	'20219930',	'Tepat waktu, mudah beradaptasi, terstruktur (serius dia ngomong gini). Kekurangan pelupa, gak bisa multitasking. Gak masalah soal dinas. ',	'Reza'),
(24,	'14219623',	'-Mengerjakan sesuatu lebih teliti\r\n-Tegas dalam lingkungan kelompok\r\n-Organisasi BEM FE, memprioritaskan hal yang lebih penting lebih ke aslab\r\n-Lancar dalam menjawab pertanyaan\r\n-Bersedia ditugaskan dimanapun\r\n-Sangat Rekomen',	'Nadia Damay'),
(25,	'20219930',	'kurang fokus, dapat menangani masalahnya, ga bisa multitasking, dapat membagi waktunya..',	'Nabilla'),
(31,	'10218266',	'<p>- cukup paham dengan kelebihan dan kekurangannya</p>\r\n<p>- anak BEM, masih di BEM, jadi kepala BIRO di BEM, katanya ga banyak kerja, cuman ngawasin doang</p>\r\n<p>- brand ambasador dewaweb untuk gunadarma</p>\r\n<p>- bisa manage waktu katanya</p>\r\n<p>- ekpektasi gaji 100rb-an, gapapa kalo di bawah itu, overall itu cuma bonus, yg penting pengalaman</p>\r\n<p>- pertanyaan dia \"tentang jaga di region yg bukan region dia\"</p>\r\n<p>- suka banget sama ngajar, keliatan juga waktu tes tutor</p>\r\n<p>- recomended</p>',	'Bili'),
(27,	'12345677',	'<p>- tes 1</p>\r\n<p>- tes 2</p>',	'test'),
(28,	'13219687',	'Orangnya moody, Suka lupa, Kurang teliti, Lebihnya on  time. Ikut HImamen. Prioritasnya tergantung tugas penting atau engga. Disiplin. ',	'Reza'),
(29,	'13219687',	'aktif dalam berorganisasi, kekurangan pelupa dan moodyan. kelebihan tepat waktu dan suka tantangan. kurang yakin dalam memprioritaskan organisasi atau lab..',	'Nabilla'),
(30,	'26219434',	'-Kurang tegas dan ragu dalam hal berbicara\r\n-Humble bersama teman-temannya\r\n-Mengikuti organisasi keagamaan dikampus\r\n-Ga mersalah ipk turun karna lab\r\n-Bersedia jika dinas ke regional lain\r\n-Lebih mementingkan kuliah dari pada lab\r\n\r\n(Rekomendasi)',	'Rifky Andhika'),
(32,	'50219469',	'<p>- anak BEM</p>\r\n<p>- ikut kominitas belajar di cirebon</p>\r\n<p>- kuliah beasiswa penuh dari gunadarma (kyk reza tapi D3)</p>\r\n<p>- bakal jaga supaya IPK ga turun (iyalah, syarat beasiswa soalnya)</p>\r\n<p>- ekspektasi gaji \"100 atau 200\", dibawah itu juga gapapa, yg penting pengalaman</p>\r\n<p>- pertanyaan dia \"jobdesk selain tutor jadi apa?\"</p>',	'Bili'),
(33,	'21218859',	'<p>- \"kekurangan saya suka belibet kalo ngomong\" (keliatan sih)</p>\r\n<p>- kuliahnya kupu-kupu aja sejauh ini</p>\r\n<p>- creator di wattpad</p>\r\n<p>- pernah coba lab akutansi menengah, gagal di wawancara terakhir</p>\r\n<p>- ini orang niat mau masuk lab, ga mau kupu-kupu lagi dia, ingin belajar di luar kelas</p>\r\n<p>- jawaban tentang bentrok lab sama quiz masuk akal</p>\r\n<p>- cuma peduli pengalaman, ga peduli gaji</p>\r\n<p>- ga akan bawa masalah pribadi ke lab</p>\r\n<p>- pertanyaannya \"kegiatan lain selain jaga lab\"</p>',	'Bili'),
(34,	'22219125',	'<p>- kekurangan \"gampang panik sama suka minder\"</p>\r\n<p>- pernah daftar madas, gagal di wawancara staff</p>\r\n<p>- katanya tertarik belajar perbankan</p>\r\n<p>- agak takut2 gitu jawabnya</p>\r\n<p>- ekspektasi gaji \"di atas 500rb\" (langsung sebutin nominal tanpa dipaksa), tapi katanya ga berpatok gaji</p>\r\n<p>- ga ada pertanyaan</p>',	'Bili'),
(35,	'22219457',	'<p>- katanya ga bisa bohong, kekurangannya ga bisa langsung paham kalo dijelasain materi</p>\r\n<p>- selain kuliah ada bantu usaha punya saudara (laundry)</p>\r\n<p>- ga ikut organisasi</p>\r\n<p>- ingin cari tau menjadi tutor yg baik sama cari networking</p>\r\n<p>- tidak mengharapkan gaji, waktu dibujuk sebut nominal \"gausah tinggi2, 500 deh\"</p>\r\n<p>- tidak ada pertanyaan</p>',	'Bili'),
(36,	'15218320',	'<p>- anti \"H-1\"</p>\r\n<p>- prioritasin kuliah, lab sebagai penunjang</p>\r\n<p>- pernah daftar madas sama mamen, madas gagal di wawanara staff, mamen di tes tulis</p>\r\n<p>- mau mengembangkan diri di bidang akademik dan non akademik</p>\r\n<p>- katanya \"pengalaman\" lebih dari \"IPK\"</p>\r\n<p>- salemba udah biasa ke region mana aja</p>\r\n<p>- ekspektasi gaji dibawah 300k atau 200k, tapi ga gitu peduli juga</p>\r\n<p>- ga ada pertanyaan</p>',	'Bili'),
(37,	'16219706',	'<p>- waktu sebut kekurangan kelebihan keliatan ngehafal</p>\r\n<p>- ga ikut organisasi, bantu2 orang tua jualan (warteg)</p>\r\n<p>- pernah daftar lab tapi lupa apa, kyknya mamaen, gagal di tes tulis</p>\r\n<p>- ekspektasi gaji 300rb, di bawah itu gapapa</p>\r\n<p>- pertanyaannya, tentang \"jadwal jaga\"</p>\r\n<p>- agak gimana gitu wkwk</p>',	'Bili'),
(38,	'52419886',	'<p>- kekurangan suka typo pas ngoding katanya</p>\r\n<p>- ikut DSC</p>\r\n<p>- main wild rift, ml, pubg di komputer, valorant</p>\r\n<p>- nonton one piece, conan, naruto, boruto</p>\r\n<p>- ingin tau programming di suatu lab</p>\r\n<p>- kadang ga nyambung, suka ke mana-mana jawabnya</p>\r\n<p>- ekspektasi gaji 500rb atau 300rb, tapi ga kepikiran buat digaji</p>\r\n<p>- nanya \"programmer ngapain aja, sama ruangan lab kita di mana\"</p>',	'Bili'),
(39,	'26218528',	'-Percaya diri tapi ada yang jawabnya muter muter\r\n-Dulu pernah BEM tapi sekarang sudah mengundurkan diri\r\n-Daftar di loket, lab akuntansi dan manajemen sampe sekarang belum diterima\r\n-Bersedia ditugaskan dimanapun, tetapi tidak bisa naik motor\r\n-Mementingkan hal yang lebih penting dahulu\r\n-Sedikit Rekomen',	'Nadia Damay'),
(40,	'25219536',	'<p>- suka ga enakan</p>\r\n<p>- suka belajar psikolog dan filsafat</p>\r\n<p>- sangat baik dalam menghadapi tekanan</p>\r\n<p>- punya usaha hidroponik, sama ikut komunitas di parung panjang</p>\r\n<p>- punya lingkungan yg suportive</p>\r\n<p>- pernah ikut madas, sampe tahap berkas</p>\r\n<p>- speakingnya bagus</p>\r\n<p>- jawaban dia bentrok sama quiz masuk akal</p>\r\n<p>- bagian tugas ke luar region, dia gapapa, tapi yg kalimalang sama cengkareng agak ragu karena jauh dari tempat tinggal, kalo yg cengkareng jadi gapapa karena ada tayo</p>\r\n<p>- ga ekspek gaji banyak, yg penting bisa nutupin kuota (100rb, 200rb), kalo ga pun gapapa \"uang belakangan\"</p>\r\n<p>- cara dia jawab yg ada masalah sama temen lab, itu masuk akal banget</p>\r\n<p>- pertanyaan dia \"yg baru daftar kalo nanti keterima langsung jadi tutor atau?\"</p>',	'Bili'),
(41,	'15219034',	'Kerja keras, periang, tapi grogi. Cepet akrab, Deadliner.     Punya keluarga asisten lab jadi tau soal lab. SMK jurusan akuntansi, pernah PKL sesuai jurusan. Gak terlalu mentingin gaji. Bagus.',	'Reza'),
(42,	'15219034',	'Frinendly,bisa bekerja sama, komunikasi baik, kekurangan mengerjakan sesuatu secara dadakan namun tetap teliti. pernah mengikuti  organisasi. cukup aktif',	'Nabilla'),
(43,	'24219582',	'Teliti, Suka hitung2an, Bisa bahasa inggris (Katanya). Bisa berkomunikasi dengan baik. Panikan. Ikut Fajrul islam. Ngomongnya rada pelan. Sekarang tinggal di bengkulu. Suka mengajar.',	'Reza'),
(44,	'24219582',	'Kurang fokus, menyukai hitungan, bisa bekerja sama, kekurangannya panikan. namun bisa menangani masalhnya. memprioritaskan kuliah baru lab. cukup aktif',	'Nabilla'),
(45,	'24219901',	'Bicaranya gugup banget. Grogi baget. Tapi attitudenya bagus. ',	'Reza'),
(46,	'24219901',	'Grogi bgt, minat terhadap lab ini tinggi.',	'Nabilla'),
(47,	'20219532',	'-Berbicara dengan sopan dan agak gugup\r\n-Berani nyoba hal yang baru dan berusaha\r\n-Belum begitu tau tentang lab manlan\r\n-Bersedia dinas ke region lain\r\n-Masuk lab ini karna belajar menjadi tutor\r\n-ingin digaji 500 ribu\r\n\r\n(Belum bisa direkomendasi)',	'Rifky Andhika'),
(48,	'17218745',	'Agak grogi. Public speaking kurang. Time management kurang. Jaringannya kacau. Attitudenya bagus.',	'Reza'),
(49,	'17218745',	'Cukup aktif, kekurangan speaking masih gugup dan kurang bisa membagi waktu  namun bisa mengatasi masalhnya. friendly',	'Nabilla'),
(50,	'16218024',	'-Kekurangannya mengerjakan tugas saat mepet deadline\r\n-Percaya diri\r\n-Mengikuti organisasi UKM Karate dan persatuan minang.\r\n-Memprioritaskan lab\r\n-Kedua kalinya daftar manlan nih\r\n-Sedikit Rekomen',	'Nadia Damay'),
(51,	'24219619',	'Rapih, pekerja keras. Ragu soal gaji. Maunya nego. Gak bisa ngerjain tugas dadakan. ',	'Reza'),
(52,	'24219619',	'Gugup, kurang fokus, kelebihan terstrukur dan rapih, kekurangannya ga suka berantakan. sedikit ragu soal dinas, dan ga bisa mengerjakan tugas dadakan. untuk gaji minta 500-1 jt. klu kurang nanti nego',	'Nabilla'),
(53,	'14219633',	'Suka bersosialisasi. Bicaranya enak. Agak bingung kalo ngejawab. Bisa public speaking (katanya). Suka tidak tepat waktu, gugup kadang.',	'Reza'),
(54,	'14219633',	'Gugup, terlalu lama mikir. suka bersosialisasi, percaya diri. kekurangannya kurang tepat waktu , gugup tp bisa menanganinya. bersedia dinas tidak maslah dengan gaji',	'Nabilla'),
(55,	'26218514',	'-moddyan orangnya\r\n-Jujur, tegas dan bertanggung jawab\r\n-Masuk ke lab sini ingin menambah pengalaman dan relasi teman\r\n-Bersedia jika dinas ke region lain\r\n-Memilih kuliah sebagai prioritas tergantung dari dosen matkul tersebut\r\n-Menyelesaikan masalah dengan secara pribadi\r\n\r\n(Rekomendasi sekali)',	'Rifky Andhika'),
(56,	'15219860',	'Pede. Mudah lupa. Ngomongnya lancar. Bawaannya enjoy. Rekomen.',	'Reza'),
(57,	'15219860',	'asik, cukup aktif, lancar menjawab. kekurangan lupa dan pesimis. kelebihan selalu mau blajar. tidak baperan. bekerja keras. tidak memperpanjang masalah. bisa bekerja dibawah tekanan',	'Nabilla'),
(58,	'11219856',	'Ngomongnya lancar banget kaya wastu. Bisa bekerja sama. Cepat belajar. Kurang teliti. Rekomen.',	'Reza'),
(59,	'11219856',	'lancar dalam wawancara, terlihat percaya diri. kelebihan anaknya aktif, sosialisasi bagus, friendly, cepat memahami materi. kekurangannya teledor namun bisa menanganinya dengan lebih teliti. tidak masalah dinas, gaji juga tidak masalah. minat terhadap lab tinggi. rekomendasii bgtt',	'Nabilla'),
(60,	'15219063',	'Lancar kalo jawab. Mandiri. Bagus sih. Rekomen.',	'Reza '),
(61,	'15219063',	'cukup lancar menjawab walau sedikit gugup, kekurangan ceroboh, pelupa tp bisa menanganinya. kelebihan mandiri, tidak masalah gaji dan dinas. ',	'Nabilla'),
(62,	'20219014',	'-Dapat bekerja dibawah tekanan dan berusaha semaksimal mungkin\r\n-Suka membantu teman-temannya\r\n-Bekerja ngajar dibimbel dan sedang belajar bahasa thailand\r\n-Management waktu yang baik\r\n-Bersedia dinas ke regoin lain\r\n-Orangnya tegas dan asik\r\n\r\n(Rekomendasi)',	'Rifky Andhika'),
(63,	'27219068',	'Jawabnya gugup banget. Suka bank dan perbankan. ',	'Reza'),
(64,	'27219068',	'kekurangan grogi,  gampang beradaptasi, cukup lancar',	'Nabilla'),
(65,	'55419131',	'-Cepat memahami hal yang baru\r\n-Adaptasi lingkungan baru yang agak lama\r\n-Mampu bekerja dalam team\r\n-Selama pandemi ikut pelatihan coding seperti dicoding dll\r\n-Mengikuti himpunan jambi\r\n-Time Management yg bagus\r\n-Sangat percaya diri\r\n-Bersedia dinas ke region lain\r\n-Memprioritaskan kuliah dahulu\r\n\r\n(Rekomendasi)',	'Rifky Andhika'),
(66,	'12118506',	'-Butuh waktu dilingkungan yang baru dan grogi di depan umum\r\n-Mempunyai rasa ingin tau yang tinggi\r\n-Kegiatan selain kuliah editing foto dan belajar database\r\n-Ingin memiliki pengalaman baru dan menambah uang saku\r\n-Bersedia dinas ke region lain\r\n-Memprioritaskan kuliah \r\n\r\n(Rekomendasi)',	'Rifky Andhika'),
(67,	'11218841',	'-Belum berani bicara didepan umum\r\n-Membantu kaka jualan online\r\n-Dalam menjawab pertanyaan kurang percaya diri\r\n-Tidak keberatan ditugaskan jauh\r\n-Tapi, tidak rekomen',	'Nadia Damay'),
(68,	'27219184',	'-Ambisius dalam menyelesaikan sesuatu\r\n-Membantu orang tua dikedai\r\n-Bersedia ditempatkan dimanapun\r\n-Percaya diri dan sudah daftar banyak lab\r\n-Rekomen',	'Nadia Damay'),
(69,	'21219395',	'-Berbicaranya percaya diri dan berani\r\n-Banyak bercerita\r\n-Organisasi Fajrul Islam\r\n-Lancar dalam menjawab pertanyaan dan percaya diri\r\n-Tegas\r\n-Sangat Rekomen',	'Nadia Damay'),
(70,	'13219639',	'-Suka Menghitung\r\n-Sedikit Gugup\r\n-Bersedia ditempatkan dimanapun\r\n-Sedikit rekomen',	'Nadia Damay'),
(71,	'50418781',	'<p>- bisa python, java, vb, database</p>\r\n<p>- pernah bikin website CRUD</p>\r\n<p>- orangnya agak terbata-bata</p>\r\n<p>- agak ga nyambung</p>\r\n<p>- main game rpg dari pc</p>\r\n<p>- bangga ketika programmnya bisa dipake orang lain</p>\r\n<p>- pernah coba labti di semester lalu, ga lolos di tes program</p>\r\n<p>- sepertinya bertanggung jawab</p>\r\n<p>- waktu pertanyaan bentrok jadwal, langsung jawab minta temen ganti</p>\r\n<p>- ikhlas dengan gaji berapapun yg diberikan, katanya dari temen2 gajinya sekitar 300an</p>\r\n<p>- kalo ada masalah, minta maaf duluan</p>\r\n<p>- pertanyaannya tentang perbandingan dengan labti (jobdesk)</p>\r\n<p>- nanya tentang bahasa pemrograman yg harus dikuasai</p>\r\n<p>- nanya asisten programmer digabung apa gimana saat praktikum</p>\r\n<p>- kyknya niat banget mau join</p>',	'Bili'),
(72,	'11218191',	'<p>- bisa membagi waktu dan siap menerima tantangan apapun</p>\r\n<p>- kekurangannya kurang memahami komputer</p>\r\n<p>- nonton netflix</p>\r\n<p>- menjadi asisten bisa menjadi kebanggaan tersendiri</p>\r\n<p>- dia tau lab kita ga ada modul</p>\r\n<p>- terlihat friendly</p>\r\n<p>- join asisten buat pengalaman dan sertifikat, bukan gaji</p>\r\n<p>- kalo sebut nominal, ekspektasinya 300, tapi gapapa kalo di bawah itu kembali lagi jawaban yg di atas</p>\r\n<p>- ga ada pertanyaan</p>\r\n<p>- bener2 keliatan ingin cari pengalaman biar kuliah ga kupu2 terus</p>\r\n<p>- catatan khusus: suaranya lembut banget</p>',	'Bili'),
(73,	'11218235',	'<p>- orangnya ambisius dan perfeksionis katanya</p>\r\n<p>- dulu pernah di himpunan mahasiswa minang gitu</p>\r\n<p>- pernah coba lab manajemen menengah sama ilab, mamen ga lolos tes tutor sama ga lolos tes wawancara di ilab</p>\r\n<p>- ga tau kalo asisten tu digaji</p>\r\n<p>- \"ga tau dah, 500 sampe sejuta kali? ga tau kak, saya ga tau kalo asisten dapet gaji\"</p>\r\n<p>- pertanyaannya \"semester kapan mulai praktikumnya, sama sebelum mulai praktikum bakal ada semacam pertemuan dulu apa engga\" </p>\r\n',	'Bili'),
(74,	'22219354',	'<p>- terlalu ambisius katanya</p>\r\n<p>- bisa bekerja di bawah tekanan katanya</p>\r\n<p>- active ikut voulenteer</p>\r\n<p>- ikut comma design, sebagai bendahara</p>\r\n<p>- suka nonton series barat</p>\r\n<p>- sejak masuk kampus sudah pengen jadi aslab, karena tantenya dulu aslab akuntansi</p>\r\n<p>- orangnya tidak pernah puas jadi ga tau hal apa yg dibanggakan</p>\r\n<p>- pernah ikut akdas ga lolos</p>\r\n<p>- pengen bagusin cv sama ngembangin public speaking</p>\r\n<p>- pengen banget join lab</p>\r\n<p>- lebih prioritasin kuliah jika terjadi bentrok jadwal</p>\r\n<p>- belum mikir dapet gaji berapa \"tapi kyknya 500rb? tujuan awal saya pengalaman sih kak, ga begitu beharap digaji\"</p>\r\n<p>- sangat menghindarin konflik, kemungkinan kecil untuk bisa konflik, kalo pun salah, nanti minta maaf duluan</p>\r\n<p>- saya kadang cuek sama egois, \"kalo kamu mau belajr ya udah, kalo engga ya udah sana keluar\" (tentang pertanyaan praktikan rese)</p>\r\n',	'Bili'),
(75,	'11219457',	'<p>- pernah mengikuti olimpiade ekonomi, gunadarma</p>\r\n<p>- suka eksplor diri sendiri</p>\r\n<p>- orangnya panikan</p>\r\n<p>- cara ngatasinnya hadapin aja, biar terbiasa</p>\r\n<p>- public speakingnya bagus</p>\r\n<p>- belum ada hal yg bisa dibanggakan, makanya coba ikut oprec ini biar dapet sesuatu</p>\r\n<p>- ingin meningkatkan kualitas diri dan pengen punya pengalaman kerja</p>\r\n<p>- terlihat sangat ingin join lab</p>\r\n<p>- dia udah research tentang lab ini, sampe tau masa lalu manlan saat masih jadi lab perbankan di bawah naungan STIE</p>\r\n<p>- sangat ingin pergi ke region2 lain wkwk</p>\r\n<p>- sangat rasional, logikanya jalan</p>\r\n<p>- ekspektasi gaji \"mungkin 300 kak? itu pun udah lumayan banget, yg penting saya dapet pengalamannya\"</p>\r\n<p>- \"lagipula saya itu masih tanggungan orang tua saya kak, jadi ga ada keperluan mendesak yg saya sendiri yg harus bayar itu ga ada,, jadi digaji berapapun itu gapapa, bisa buat jajan pinggir jalan juga udah lumayan\"</p>\r\n<p>- pertanyaannya \"jadi aslab itu berapa lama\"</p>\r\n<p>- entah kenapa mirip cahya</p>',	'Bili'),
(76,	'16219940',	'<p>- on time katanya</p>\r\n<p>- kekurangannya pelupa</p>\r\n<p>- freelance nyari customer buat ngiklan di mana gitu</p>\r\n<p>- udah pengen join lab dari semester 1, biar lebih produktif</p>\r\n<p>- ingin membawa perubahan ke lab manajemen lanjut, ke arah kebih baik katanya</p>\r\n<p>- lebih prioritas kuliah kalo bentrok</p>\r\n<p>- ekspektasi gaji \"2 juta, 3 juta\"</p>\r\n<p>- tapi ga berpatokan ke gaji, pengen join lab aja</p>\r\n<p>- \"ga adil kalo gaji lab kita beda dengan gaji lab sebelah\"</p>\r\n<p>- ga ada pertanyaan</p>',	'Bili'),
(77,	'13219539',	'<p>- hobi basket</p>\r\n<p>- kekurangannya pelupa, dan suka ngaret kalo ga urgent urgent banget</p>\r\n<p>- main ML</p>\r\n<p>- ikut beberapa organisasi di luar kampus</p>\r\n<p>- \"belum ada hal yg bisa aku banggakan kak\"</p>\r\n<p>- pengen ngembangin kualitas diri mumpung masih tingkat 2</p>\r\n<p>- terlihat sangat ingin join lab</p>\r\n<p>- ga tau kalo jadi asistennya digaji\r\n<p>- mungkin \"500-an kali? ga tau kak kalo digaji\"</p>\r\n<p>- \"saya ga tau kalo digaji jadi mau dikasih berapa aja syukur banget\" (kaget gitu ekspresinya pas tau ternyata dibayar)</p>\r\n<p>- pertanyaannya \"kalo misal saya ga keterima, masih bisa ikut lagi oprec ga kak?\"</p>\r\n<p>- catatan tambahan: dia cadel cadel manis gitu</p>',	'Bili'),
(78,	'24218145',	'<p>- suka grogi di depan umum, sama kurang bisa menghafal</p>\r\n<p>- orangnya terstruktur katanya</p>\r\n<p>- dulu pernah ikut forum komunikasi kelas 2 semester</p>\r\n<p>- sempet daftar akdas tapi telat ngumpulin berkas</p>\r\n<p>- agak terbata-bata</p>\r\n<p>- agak ga nyambung juga</p>\r\n<p>- join lab salah satu pencapaian yg ingin dicapai</p>\r\n<p>- lebih memilih lab kalo bentrok katanya</p>\r\n<p>- lebih pilih quiz kalo quiz</p>\r\n<p>- ekspektasi gaji \"mengikuti dari lab aja kak, tapi semoga cukup buat beli kuota\"</p>\r\n<p>- \"mungkin 500rb kak?\"</p>\r\n<p>- tapi gapapa kalo dibawah itu gajinya, yg penting pengalamannya</p>\r\n<p>- pertanyaannya \"suka duka jadi aslab\"</p>',	'Bili'),
(79,	'15219001',	'<p>- kekurangannya pelupa</p>\r\n<p>- kelebihannya always on time</p>\r\n<p>- udah biasa di bawah tekanan karena sempet kerja di pt</p>\r\n<p>- ngambil kelas malem</p>\r\n<p>- organisasi keagamaan</p>\r\n<p>- kelihatan bertanggung jawab</p>\r\n<p>- \"aku bangga aku tinggi\"</p>\r\n<p>- masuk lab biar kuliah ga gini gini aja, sama bisa paham materi perbankan, soalnya yg dijelasin dosen kaga ngerti bahasanya alien semua</p>\r\n<p>- seneng pindah2 region</p>\r\n<p>- kalo bisa terus tetep di lab sampe jadi staff juga gapapa katanya, malah bagus</p>\r\n<p>- ekspektasi gaji \"mungkin 1jt sampe 1,5jt kali?\", tapi ga peduli dapet berapa karena tetep untung bisa dapet pengalaman</p>\r\n<p>- terlihat professional</p>',	'Bili'),
(80,	'16118823',	'<p>- sering ngaret</p>\r\n<p>- ikut BEM Fikti</p>\r\n<p>- deadliner</p>\r\n<p>- pernah labsi 2 semester</p>\r\n<p>- BEM nya udah jadi wakil kepala department olahraga, jadi cuman ngawasin doang kata dia ga sibuk2 banget</p>\r\n<p>- bangga dengan pengendalian diri</p>\r\n<p>- pindah dari labsi karena ada hal yg kurang nyaman, sama modulenya kurang update katanya</p>\r\n<p>- masuk manlan ingin coba lingkungan baru, karena selama ini fikti fikti mulu</p>\r\n<p>- gua ga banyak komen deh, indihome tiba2 ngambek (sama takutnya bias), kalo dari gua dia recommended</p>',	'Bili'),
(81,	'10218266',	'anaknya super aktif, untuk kegiatan lumayan banyak, rajin, penampilan rapih, 100% mau masuk lab, pas nutor yg niat pake papan tulis, gapeduli gaji hanya mementingkan keuntungannya jadi asisten, pembawaannya santai, fix rekomend buat ke tahap staff.',	'Narwastu'),
(82,	'50219469',	'pembawaan saat wawancara cukup tenang\r\nuntuk jaga tiap region siap2 aja maupun harus pergi subuh\r\ndia bisa berusaha ngatasin masalah \r\nikut komunitas belajar buat anak2nya yg kurang mampu gitu',	'Narwastu'),
(83,	'21218859',	'anaknya kupu2 udah tk 3, ada jiwa insecurenya, lumayan kagok kali lagi ngobrol gitu, pernah daftar lab tp ga lolos, nulis cerita di wattpad tembus 1000org yg baca, pengen banget keterima di lab dia berusahaa biar berguna pas kuliah ga kupu2 lagi',	'Narwastu'),
(84,	'22219125',	'b aja sih tadi, dia kagok gitu karna panik kayak takut salah, sempat ga ngasih tau nominal gaji cuma disebut tp dia gapeduli gaji  yang dipentinginnya pengalaman dan nambah wawasannya',	'Narwastu'),
(85,	'22219457',	'anaknya kupu2, dia bantu usaha pamannya, simpel aja sih tadi, dia kurang paham penjelasan dari dosen, buat catatan buat belajar dan dia bisa paham, buat gaji ekspeknya 500an ',	'Narwastu'),
(86,	'15218320',	'anaknya gasuka dikejar deadline, keliatan ambis tugas soalnya lebih pro kuliah dibanding lab.',	'Narwastu'),
(87,	'16219706',	'b aja, kayaknya kurang serius buat daftar lab soalnya pas ditanya pernah daftar apa dia ga inget (masa iya bisa ga inget yakan), anaknya kupu2 ',	'Narwastu'),
(88,	'52419886',	'anaknya  ga sukaliat  kekamera sepertinya soalnya ga liat layar gitu, kegiatannya lumayan okee, pengen nambah wawasan jd programmer di lab itu kyk gimana',	'Narwastu'),
(89,	'25219536',	'ini mantap laa soalnya dia suka belajar sikolog sama filsafat jadi bisa ngepahamin buat org2 yg sekitaran dia, suka ngebantu org soalnnya dia gak enakkan gt, dikampus kupu2 tp ada kegiatan diluar, niat sih sepertinyaa diaa lolosin ajaa dulu wkwk',	'Narwastu'),
(90,	'50418781',	'keliatan anaknya seganan gitu, ngomongnya kyk serius bat gitu dan malu2 sepertinya, kegiatannya lumayan oke soalnya banyak gt, sepertinya dia udh lumayan tau seputar lab gmn dari temen2nya udh tk 3, tapi dia bangga sama dirinya kalo programnya dipake org, lolosin aja dulu gaiss',	'Narwastu'),
(91,	'11218191',	'baru beres sidang, sepertinya bagi waktu bisa, ga terlalu peduli gaji, dia berusaha gammau jadi kupu2 lagi soalnya gaada kegiatan, tp b aja sih tadi ',	'Narwastu'),
(92,	'22219354',	'ambis dijadikan kekurangan, baru masuk organisasi tp menjabat juga, rekomend tantenya masuk aslab aja, pernah daftar di akdas, anaknya baik mau minta maaf deluan tapi ada rasa egoisnya sama org dalam hal belajar',	'Narwastu'),
(93,	'52419856',	'sangat antusias terhadap programming, semangat belajar tinggi.\r\naktif organisasi, internal dan eksternal.\r\nbanyak ikut kegiatan&komunitas program (dsc ug).\r\nmanajemen waktu baik, cukup ambisius.\r\nloyal, tidak mengharapkan gaji',	'aisy'),
(94,	'16218735',	'tidak mengikuti organisasi.\r\npernah daftar di lab manajemen dasar smt.3 dan manajemen menengah di smt.4\r\ncita-cita menjadi guru, salah satu alasan bergabung di lab manlan.\r\nlumayan paham ttg lab manajemen lanjut.\r\nbertekad profesional.\r\nmemiliki prioritas : ibadah, keluarga, pendidikan.\r\nkomunikasi cukup baik, bisa merangkai kata kata.',	'aisy'),
(95,	'16217096',	'pengalaman : relawan pajak. \r\npernah ikut bem.\r\nkomunaksi kurang baik, tidak pandai merangkai kata2, dan kebanyakan diam.\r\ndiem mulu, sepertinya kurang recomended untuk masuk list.',	'aisy'),
(96,	'16118925',	'komunikasi bagus.\r\nbanyak ikut organisasi (bem, dsc).\r\njadi spv di dsc ug.\r\npribadi yg terorganisir.\r\nsangat paham tentang softskill.\r\nloyalitas tinggi, mendahului lab ini dibandingkan bem dan dsc.\r\nalasan masuk lab manajemen ingin eksplore lebih dan mengenal lingkungan baru.\r\nskill komunikasi luwes dan tegas.',	'aisy'),
(97,	'16219615',	'tidak ikut organisasi/ukm di kampus maupun di luar.\r\nskill komunikasi kurang baik, gugup.\r\ntidak percaya diri.\r\ntidak bisa mengatasi tekanan ketika wawancara (terutama jika ada sanggahan).',	'aisy'),
(98,	'21218910',	'skill komunikasi baik, pandai merangkai kata2.\r\nlumayan dapat mengatasi tekanan ketika wawancara.\r\nloyalitas lumayan tinggi.\r\nsopan santun. cara bicara bagus lancar.\r\nbersedia jaga di luar region depok.',	'aisy'),
(99,	'15219072',	'komunikasi cenderung kurang baku.\r\nlumayan lancar untuk sesi wawancara, sedangkan waktu tes tutor kurang bagus mungkin masih gugup.\r\ntidak memiliki pengalaman organisasi di kampus.\r\nuntuk pembicaraan saat wawancara lumayan, dapat menguasai topik yang sedang diobrolkan.\r\ntapi masih kurang percaya diri.',	'aisy'),
(100,	'11219457',	'ikut bisnis building dari bem, orangnya menarik soalnya cara bicaranya bagus, dia explore lab ini dari web kita cuma dia sendiri yg explore ampe jauh bat, dia suka buat note jugaa karna pelupa',	'Narwastu'),
(101,	'10219574',	'skill komuniikasi bagus, lugas dan lancar.\r\ndia tertarik dengan perbankan jadi alasan untuk masuk ke lab manlan.\r\nbersedia untuk jaga di luar region.\r\nbelum pernah ikut organisasi kampus.\r\nditanya loyalitas untuk lab ini : 95.\r\norangnya kelihatannya rapih banget, cekatan, dan bisa mengatasi tekanan ketika wawancara.\r\nbisa membuat pembicaraan menjadi tidak canggung.',	'aisy'),
(102,	'23219287',	'penampilan rapih.\r\nbelum terlalu banyak pengalaman organisasi.\r\nditanya komitmen & loyalitas : 85.\r\nskill komunikasi baik dan bisa membawa suasana, tetapi anaknya masih kurang percaya diri dengan apa yang dia ketahui.\r\nlumayan bisa mengatasi tekanan dan sanggahan ketika wawancara.',	'aisy'),
(103,	'16219940',	'kegiatan kampus ga ada tp diluar ada, cuma ekspek gaji jauh bat tembus 3jt, dia ga terima kalo gaji dilab lain lebih gede pdhl jadwal jaganya sama, aslinya ga berpatokan sih, kurang sih dia ini:(',	'Narwastu'),
(104,	'14219765',	'rapih, kelihatannya cekatan.\r\nskill komunikasi luwes, lancar, formal.\r\npembawaan nya tenang dan sangat cekatan.\r\nbagus dehh, rekomended untuk jadi tutor yang jelas dan tegas.',	'aisy'),
(105,	'16219772',	'komunikasi nya masih belum luwes, masih suka mikir panjang.\r\nkurang bisa mengatasi tekanan pada saat wawancara.\r\nmengharapkan gaji 1juta - 1,5 juta wkwkwkk.\r\ntidak ikut organisasi kampus, tetapi pernah ikut organisasi eksternal.\r\npernah bekerja part time.',	'aisy'),
(106,	'54418738',	'lumayan humoris wkwk. \r\nmasih gugup berbicaranya, tp bisa merangkai penggunaan kata2.\r\naktif ikut magang, pernah jadi bem.\r\npekerja keras, bisa menghadapi deadline dengan cepat katanya.\r\nskala loyalitas untuk lab 80.\r\nmasih ragu2 dalam menjawab pertanyaan.\r\nbisa membawa suasana wawancara menjadi lebih hidup dan bisa mengatasi tekanan / sanggahan pada saat wawancara.\r\nlumayan recomended & patut dipertimbangkan.',	'aisy'),
(107,	'11219218',	'komunikasi masih ragu2, harus ditanya dulu baru bisa jawab.\r\nkurang bisa merangkai kata, menjawab nya lama.\r\njawaban bertele-tele, kurang recomended.',	'aisy'),
(108,	'26219304',	'komunikasi tidak luwes.\r\nkurang bisa merangkai kata2, masih ragu2.\r\nbelum memiliki pengalaman organisasi di kampus.\r\npernah daftar di lab maddas katanya, tp gak diterima.\r\ntingkat loyalitas 80-85.\r\ntidak rekomen karena pembawaannya ragu2 dan tidak percaya diri.',	'aisy'),
(109,	'17218261',	'skill komunikasi masih tidak stabil, kadang lancar kadang masih ragu2.\r\naktif ikut organisasi eksternal tentang foto produk, editing video.\r\nbisa edit grading warna untuk foto / video.\r\nperangkaian kata2 lumayan bagus, luwes.\r\nyakin bisa bekerja dibawah tekanan, tingkat loyalitas ke lab 75-80.\r\nmotivasi utama masuk manlan karena memperluas relasi.',	''),
(110,	'17218261',	'skill komunikasi masih tidak stabil, kadang lancar kadang masih ragu2.\r\naktif ikut organisasi eksternal tentang foto produk, editing video.\r\nbisa edit grading warna untuk foto / video.\r\nperangkaian kata2 lumayan bagus, luwes.\r\nyakin bisa bekerja dibawah tekanan, tingkat loyalitas ke lab 75-80.\r\nmotivasi utama masuk manlan karena memperluas relasi.',	'aisy'),
(111,	'23219378',	'skill komunikasi kurang bagus, gugup.\r\nagak ngegas. ngomongnya kurang jelas dan tegas.\r\nmukanya ketutupan.\r\ntidak rekomen, karena searching.\r\nini yang waktu ditanya \"kontribusi apa yang akan kamu berikan ke lab ini\" trus dia searching dulu :)',	'aisy'),
(112,	'25218655',	'organisasi relawan pajak.\r\nloyalitas lumayan tinggi.\r\nskill komunikasi bagus, luwes, dan tegas.\r\nprioritas : ilmu, ortu, teman.\r\nmenebak gaji 200ribu.\r\nlumayan rekomen karena bisa membawa suasana juga & tidak canggung.',	'aisy'),
(113,	'12119500',	'belum pernah mengikuti organisasi.\r\npernah daftar ilab tp belum diterima.\r\nskill komunikasinya lumayan baik, tp tidak terlalu tegas.\r\nmendaftar lab manlan karena kebetulan lihat dan tertarik.\r\nloyalitas kuliah 60, lab 40.\r\nkurang percaya diri, tetapi lumayan bisa membawa suasana wawancara tidak terlalu canggung.\r\n(menurut saya agak 50:50 sih dia, bagus tp masih kurang yakin.)',	'aisy'),
(114,	'13219539',	'anak kosan jadi suka ngaret gitu, anaknya polos bener2 blm tau seputar lab ditanya gaji dia gatau kalo ada gaji di lab, kontribusinyaa niat banget mau masuk lab',	'Narwastu'),
(115,	'52419856',	'passion programming, tanggungjawab, introvert dan minder namun berusaha mengubahnya dengan cara masuk di lab manlan. cara jawabnya tegas dan meyakinkan, penuh semangat gitu. ikut organisasi keagamaan lalu pernah jadi seksi acaranya, ikut DSC, Tidak permasalahkan gaji dan prioritas untuk lab katanya, komunikasi cukup baik, luwes dan lancar menjawabnya. Cukup rekomen deh.',	'Siti Kholifatun K'),
(116,	'16218735',	'Motivasi terbesar masuk lab karena memiliki cita-cita menjadi guru, saat ini hanya fokus kuliah tapi pernah ikut volunteer, dedikasi penuh buat lab katanya (waktu, ilmu, tanggungjawab dll). Tapi tetap mengedapankan kuliah, tidak permasalahkan gaji dan lumayan tau tentang lab manlan, komunikasinya cukup lancar dan tenang.',	'Siti Kholifatun K'),
(117,	'16217096',	'tingkat loyalitas skalanya 95%, ikut relawan pajak. namun komunikasi kurang lancar, kebanyakan diem dan gak bisa jawab dengan cepat, gak tau juga tentang lab manlan. masalah gaji juga gak tau. cara bicara ragu dan bingung serta gak meyakinkan. sepertinya gak rekomen sih.',	'Siti Kholifatun K'),
(118,	'24218145',	'anaknya pemalu  mangkanya grogi, pas bahas gaji dia bahas kuota mulu supaya dpt kalo lg ngajar lab, niat jadi aslab sepertinya udh tk 3, hapalan kurang, pernah daftar bem ga keterima',	'Narwastu'),
(119,	'15219001',	'pembawaannya enak, humble, anak kelas malam jd ga bentrok sama apapun, udah pernah kerja sebelumnya, anaknya motoran jadi ke region mana aja hayo aja mau liat gundar juga kyk gmn, rekomend buat di lulusin ke tahap selanjutnya',	'Narwastu'),
(120,	'16118823',	'anaknya tomboy, speaking campur inggris, hobi ngaret kalo ga penting banget dikejar deadline mulu tp selesai juga, kalo marah serem, mau nyebrang lab katanya cari suasana baru bosen di fikti, gasuka ngoding, tapi oke juga berani anaknya, hobinya jalan2 ',	'Narwastu'),
(121,	'16118925',	'aktif organisasi, jadi deputi biro litbang di bem, spv DSC, leadership yang tinggi. tipikal orang yang terorganisir jadi profesional sama tugasnya. suka explore lingkungan baru dan kegiatan baru. jiwa softskillnya sepertinya bagus. realistis terhadap besaran gaji (sepadan dengan kerjanya aja katanya). tetep prioritasin lab baru bem dan dsc. walaupun tetep liat urgensinya dulu. public speakingnya bagus, tertata, santai dan panjang lebar ketika menjawab. overall bagus, bisa dipertimbangkan.',	'Siti Kholifatun K'),
(122,	'16219615',	'saat ini hanya fokus kuliah tidak ikut organisasi, tingkat loyalitas 85%, tidak permasalahkan gaji, namun komunikasi kurang baik, gak pede dalam menjawab, respon lama dan mikir lama jadi boring wawancaranya, kurang rekomen sih jadinya',	'Siti Kholifatun K'),
(123,	'21218910',	'saat ini fokus kuliah aja, tidak permasalahkan gaji, katanya bisa bekerja sama dengan tim maupun individu, tingkat loyalitas 80%. lagi tahap pendaftaran di lab tentang perpajakan. komunikasi cukup baik. jawaban pertanyaan overall cukup standar.',	'Siti Kholifatun K'),
(124,	'15219072',	'alasan daftar untuk menambah wawasan, relasi dan challenge. saat ini hanya fokus kuliah dan ikut seminar2. punya bisnis jualan hijab sama temennya. tingkat loyalitas 80%, bersedia bertugas di semua region kampus. gak permasalahkan gaji. prioritas utama dalam hidup Allah, Orangtua, Diri sendiri. komunikasi cukup lancar dalam menjawab. ',	'Siti Kholifatun K'),
(125,	'10219574',	'tertarik dengan perbankan jadi daftar di lab manlan, saat ini hanya fokus kuliah, akan kontribusi mengembangkan lab agar lebih maju lagi, bersedia bertugas di semua region, tidak permasalahkan gaji, tingkat loyalitas 95%, komunikasinya cukup baik, cara bicaranya tenang dan responsif jadi bisa dipertimbangkan sih.',	'Siti Kholifatun K'),
(126,	'23219287',	'katanya adaptif namun kurang pengalaman jadi daftar di lab manlan. bisa kerjasama tim maupun individu. gak pede kalo menjelaskan sesuatu katanya belibet tapi berusaha yakinkan diri terus, saat ini hanya fokus kuliah, responsif namun kayak banyak mikir sih jawabnya jadi komunikasinya agak kurang, tingkat loyalitas 85%. ',	'Siti Kholifatun K'),
(127,	'14219765',	'saat ini ikut forum komunikasi kelas dan fokus kuliah, katanya cekatan dan teamwork, tingkat loyalitas 85%, komunikatif dan cukup bisa dalam menjawab pertanyaan tapi standar sih jawabannya intinya prioritasin lab dan berusaha bagi waktu dengan baik',	'Siti Kholifatun K'),
(128,	'16219772',	'saat ini hanya fokus kuliah, dulu pernah kerja part time, tingkat loyalitas 70%, ekspektasi gaji 1 jt - 1,5 jt, komunikasi kurang baik, kaya gak yakin gitu jawabnya. kurang rekomen sih',	'Siti Kholifatun K'),
(129,	'54418738',	'alumni BEM, part time tapi sesuka hati jadi gak terikat, joki juga katanya, kontribusi akan mengembangkan lab lebih baik lagi, tanggungjawab deadline pokoknya profesional kalo sudah ditugasin, komunikasinya lumayan sih cara jawabnya agak gak yakin tapi respon dengan cepat, humoris dan humble. untuk saat ini katanya gak bersedia bertugas diluar regionnya. tingkat loyalitas 80%. bisa dipertimbangkan sih',	'Siti Kholifatun K'),
(130,	'11219218',	'impian di bidang fashion, saat ini fokus kuliah saja, pernah daftar lab madas. komunikasi kurang bagus, gak semangat jawabnya jadi kurang meyakinkan. overall standar jawabannya',	'Siti Kholifatun K'),
