(132,	'17218261',	'gugup dikit, tapi komunikasinya lancar dan bisa menjawab pertanyaan walaupun kadang masih ragu-ragu gitu. suka menghitung dan teliti, suka bikin skala prioritas, tingkat loyalitas 75-80%. gaktau ada gaji dan ekspektasi 500rb. bendahara di komunitas kreatif (organisasi eksternal). kadang juga edit foto dan video produk, untuk saat ini gak bisa bertugas diluar regionnya. cara bicaranya enak didengar.',	'Siti Kholifatun K'),
